CREATE PROCEDURE dbo.proc_transform_158
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_158
    SET payload = LEFT(payload, 1000) + N'|V4-158|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_158;
END
